export default (function(a,b,c,d,e,f,g,h,i){return {data:{CWbSTyA46A:{data:{id:393,attributes:{imdbId:"tt0049027",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZGRjMzE0OTItY2U3Zi00NTk1LThjNzEtODkzNDRhZDJhZDBmXkEyXkFqcGdeQXVyNDY3MzU2MDM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"}],item_lang:{data:{id:1056,attributes:{title:d,plot:"Patrick Martin (Joseph Cotten), known as P.M., is a wealthy attorney and rancher big-man-in-town in the border town of Nogales, Arizona. He returns home to find his brother Donald (Van Johnson)hiding in his garage. A former drunkard, Donald had been sent to the penitentiary five years previously for killing a man in a barroom brawl. It was in self-defense but P.M. hadn't defended his brother and he was convicted. Donald has escaped and wants his brother to help him across the Santa Cruz River into the Mexico-side Nogales, where his wife (Shirley Patterson as Shawn Smith)and children (Kim Charney and Sandy Deschler) are in dire straits. The straits get even dier when P.M. tells him the river is flooded and it will be days before anyone can cross. And P.M. is all a'twitter because his wife Nora (Ruth Roman), whom he married after Donald had gone to prison, doesn't know about his jail-bird brother. He introduces Donald to Nora and the rest of his Cadillac Cowboy and ranch society friends as an old friend, and is kept busy trying to make sure old Donald doesn't find anything harder that ginger ale to drink. Donald gets a telephone call telling him that his family has gone from dire straits to destitution and when P.M. won't get some money to them through his contacts in the Mexico side of Nogales, Donald knocks him down and grabs a couple of bottles of whiskey and dashes out of the house into the rain.",slug:"the-bottom-of-the-bottle"}}},books:{data:[{id:565,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:a}},{id:566,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:a}},{id:567,attributes:{title:"Simenon Omnibus",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7uLxAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1976-01-01",publisher:a,subtitle:a}},{id:568,attributes:{title:"Pietr the Latvian",description:"“One of the greatest writers of the twentieth century . . . Simenon was unequaled at making us look inside, though the ability was masked by his brilliance at absorbing us obsessively in his stories.” —The Guardian In Simenon’s iconic first novel featuring Inspector Maigret, the laconic detective is taken from grimy bars to luxury hotels as he traces a fraudster’s true identity Inspector Jules Maigret, a taciturn detective and commissaire of the Paris Brigade Criminelle, receives notice from Interpol that a notorious conman known only as Peitr the Latvian is en route to France. Armed with a broad description and a scant few clues, Maigret plans to intercept him at the train station outside Paris. But when he arrives, he finds that there are several suspects—some living, and some dead—who meet the description uncannily well. Who is Pietr the Latvian, truly? A vagrant, a seaman, a businessman, a corpse? Russian, Norwegian, American or Latvian? In Pietr the Latvian, the iconic first novel of Simenon’s classic series that made Inspector Maigret a legendary figure in the annals of detective fiction, Maigret must use his every instinct to unravel the mystery and track down the truth.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YGWE7O4tWPsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2014-02-18",publisher:i,subtitle:a}},{id:569,attributes:{title:"Inspector Maigret Omnibus: Volume 1",description:"The first annual omnibus edition in the new Penguin Inspector Maigret series, comprising four titles from the series so far: Pietr the Latvian, The Hanged Man of Saint-Pholien, The Carter of La Providence and The Grand Banks Cafe. Additional material includes the original French first edition covers, art directed by Georges Simenon himself. Penguin is publishing the entire series of Maigret novels. 'Compelling, remorseless, brilliant.' - John Gray 'One of the greatest writers of the twentieth century . . . Simenon was unequalled at making us look inside, though the ability was masked by his brilliance at absorbing us obsessively in his stories.' - The Guardian 'A supreme writer . . . unforgettable vividness.' - The Independent",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=SsvsBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2015-06-02",publisher:i,subtitle:"Pietr the Latvian; The Hanged Man of Saint-Pholien; The Carter of 'La Providence'; The Grand Banks Café"}}]}}},meta:{}}},prerenderedAt:1680940931002}}("","Georges Simenon",null,"The Bottom of the Bottle","A man raised in poverty marries into a rich ranching family, he lives in fear that his past will come to haunt him and it does when his brother on the run from the law asks for help to cross the border.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WaEHAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","1977-01-01","Hamish Hamilton","Penguin"))